def list_cameras():
    for camera in cameras["CameraArray"]:
        yield {"description": camera["Description"], "geo": {"lon": camera["VERTICES"]["VERTEX_TYPE"]["X"], "lat": camera["VERTICES"]["VERTEX_TYPE"]["Y"]}, "id": camera["Id"], "format": camera["ImageName"]}